import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    webBlock: {
        flex: 1,
        margin: '50px 0',
        width: '100%',
        height: '100%',
    },
    webContainer: {
        backgroundColor: '#dfdfff',
        padding: '40px 20px',
        borderRadius: 10
    }
}))

export default useStyles
